import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
    const token = localStorage.getItem('token'); // Check for token to determine if logged in

    return (
        <div className="home">
            <h1>Welcome to Alex's BarberShop</h1>
            <p>Your one-stop shop for all your grooming needs.</p>
            <div>
                {token ? <Link to="/services" className="link">Rezervace</Link> : <Link to="/login" className="link">Login</Link>}
            </div>
        </div>
    );
}

export default Home;
